    let abc = [...(Array(tripletSum || 1000).keys())]
    let tripletCount = 0;
    abc.forEach(c => {
        for (let a = 1; a <= abc.length; a++) {
            for (let b = 1; b <= abc.length; b++) {
                if (!(a + b + c === abc.length)) continue;
                if ((a * a) + (b * b) === c * c) {
                    tripletCount += 1;
                }
            }
        }
    })
    return tripletCount;
};

